import { Router } from 'express';
import React from 'react'
import { BrowserRouter,Route,Routes } from 'react-router-dom';
import Navbar from './userComponent/Navbar'

function UserDashboard() {
  return (
    <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route exact path='/'/>

      </Routes>
    </BrowserRouter>

  );
};

export default UserDashboard
